import React from "react";

const Separator = props => {
  let propsFilled = this.props;

  return (
    <div
      style={
        propsFilled && props.location.pathname === "/"
          ? 'display: "none"'
          : 'height: "70px"'
      }
    >
      {console.log(props)}
    </div>
  );
};

export default Separator;
